/**
 * Simple parser so that we can support both
 * F3 and Java / X-Backend response, otherwise you'll
 * end up with a result.result datastructure.
 * @type {Function}
 * @param {Object} data
 * @return  {Object}
 */
export default (data) => {
	if (data.hasOwnProperty('result')) {
		return data.result;
	}
	return data;
};
